import React from 'react';
import {Link} from 'react-router-dom';

function Navigation() {
  return (
    <nav>
       <Link to="/">Home</Link>
       <br></br>
       <Link to="/login">Order</Link>
       <br></br>
       <Link to="/register">Register</Link>
       <br></br>
    </nav>
  );
}

export default Navigation;
